import React from 'react';
// import ReactDOM from 'react-dom';
import { hydrate } from 'react-dom';
import {BrowserRouter} from 'react-router-dom';
import { Provider } from 'react-redux';
import { createStore, applyMiddleware, compose } from 'redux';
import thunkMiddleware from 'redux-thunk'
import './index.css';
import App from './App';
import * as Routes from './Routes'
import mainReducer from './reducers/app';
import Api from './middlewares/api';
import promiseMiddleware from 'redux-promise-middleware';
import reportWebVitals from './reportWebVitals';

const initApp = () => {
	let preloadedState =  {};
	if (window.__STATE__) {
		preloadedState = window.__STATE__;
		delete window.__STATE__;
	}
	// Подключение Redux Dev Tools, на боевом сайте отключена запись действий
  const composeEnhancers = window.__REDUX_DEVTOOLS_EXTENSION_COMPOSE__ || compose;
	const enhancer = composeEnhancers(applyMiddleware(
		thunkMiddleware,
		Api,
		promiseMiddleware()
	));
	let store = createStore(
		mainReducer,
		preloadedState,
		enhancer
	);

  const splitPoints = window.__sf_split_points || [];
	Promise.all(
		splitPoints.map(chankName => Routes[chankName].loadComponent()) // eslint-disable-line
	).then(() => {
		const root = document.getElementById('root');
		// root.innerHTML = '';
		// render(
		hydrate(
			<React.StrictMode>
    <Provider store={ store }>
				<BrowserRouter>
					<App />
				</BrowserRouter>
			</Provider>,
  </React.StrictMode>,
			root
		);
	});
};

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
initApp();
reportWebVitals();
